import React from "react";
import "estilos.sccs";

const Login = () => {
  class Input extends React.Component {
    constructor(props) {
      super(props);
    }

    render() {
      return (
        <div className="Input">
          <label for="input1"></label>
          <input
            id="input1"
            type={this.props.type}
            name={this.props.name}
            placeholder={this.props.placeholder}
            autocomplete="false"
            required
          />
        </div>
      );
    }
  }

  class Form extends React.Component {
    constructor(props) {
      super(props);
    }

    render() {
      return (
        <div className="Form">
          <h2>Enter to your Cabinet</h2>
          <Input type="email" name="email" placeholder="user@gmail.com" />
          <Input type="password" name="password" placeholder="qwerty" />
          <button>
            Log in <i className="fa fa-fw fa-chevron-right"></i>
          </button>
        </div>
      );
    }
  }

  var App = () => {
    return (
      <div className="App">
        <Form />
      </div>
    );
  };

  ReactDOM.render(App(), document.getElementById("app"));
};

export default Login;
